import React, { Component } from 'react';
import { faHome } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

class Like extends Component {
    render() { 
        const classIcon = `${this.props.IsLiked? "fas":"far"} fa-heart`
        return (
            <i style={{cursor: "pointer"}} onClick={()=>{this.props.onClick(this.props.movie)}} className={classIcon}></i>
        );
    }
}
 
export default Like;
